class sherwinColor {
  constructor(id, name, code, family, hex, lrv, peel, light) {
    this.id = id;
    this.name = name;
    this.code = code;
    this.family = family;
    this.hex = hex;
    this.lrv = lrv;
    this.peel = peel;
    this.light = light;
  }

}

